ot pieces, as well as the treatment of periapical lesions to prevent further infection.", "duration": "4 hours"}, {"focus": "Restorative treatments to repair damage", "items": [{"price": 120, "tooth": "27", "ada_code": "D2330", "quantity": 1, "condition": "Caries", "confidence": 0.81, "recommended_treatment": "Filling"}], "stage": "Stage 2", "summary": "This stage involves filling cavities to restore tooth integrity and prevent further decay.", "duration": "1 hour"}]', '2025-08-09 00:36:52.823537+00', NULL, NULL, NULL);
INSERT INTO public.patient_diagnosis VALUES ('2e191252-e6de-45a0-8e59-cc31b5647822', 'c8e6cc50-576d-4d4d-bd88-18d5ebc20280', 'SASAS', 'https://tnkxehgocxoondivwrgs.supabase.co/storage/v1/object/public/xray-images/xrays/20250818_012137_dental_xray_2.png?', 'https://tnkxehgocxoondivwrgs.supabase.co/storage/v1/object/public/xray-images/sasas_20250818_012137_dental_xray_2_20250818_012148.jpg?', 'Periapical lesion at tooth 13 requiring Root Canal and subsequent Crown. Existing restorations noted: multiple fillings and two teeth with prior root canal treatment (no acute issues evident).', 'Panoramic suggests existing restorations: multiple fillings and two root canaltreated teeth (AI detections). No acute issues identified for those teeth; verify clinically. Manual finding: tooth 13 with periapical lesionrecommend RCT. Pre-op: obtain periapical radiograph(s) of #13 to confirm working length and lesion extent; vitality testing expected non-responsive; assess probing, mobility, percussion/palpation tenderness. Consider CBCT if complex anatomy or uncertain diagnosis. Endodontic plan: rubber dam isolation; irrigants (NaOCl/EDTA); obturation; postoperative PA. Evaluate remaining coronal structure; if limited walls remain, consider fiber post and core buildup before crown. Place definitive full-coverage crown on #13 after endodontic healing confirmation (or provisionalize and proceed if asymptomatic and sealed). Review occlusion, contact points, and ferrule. Medical/medication review; analgesic plan; antibiotics only if systemic signs spread (fever, cellulitis). Discuss risks/benefits/alternatives including extraction and implant/bridge replacement if prognosis poor. Monitor previously root canaltreated teeth for symptoms, integrity of coronal seal, and presence/absence of periapical pathology.', '[{"focus": "Eliminate infection at tooth 13 and protect the tooth from future fracture", "items": [{"price": 400, "tooth": "13", "ada_code": "D3310", "quantity": 1, "condition": "Periapical lesion (infection at root tip)", "education": {"title": "Root Canal for Periapical Lesion", "definition": "A periapical lesion is an infection and inflammation at the tip of a tooths root, usually caused by deep decay, cracks, or past trauma letting bacteria reach the nerve.", "status_line": "Status: 1 tooth (tooth 13) is affected and needs attention to stop the infection.", "risks_if_untreated": " If not treated, the infection can worsen, causing pain, swelling, bone loss around the tooth, and spread of infection. This can lead to an abscess and may ultimately require extraction. In some cases, the area can develop facial swelling and affect overall health.", "recommended_treatment": "A Root Canal removes the infected nerve tissue inside the tooth, cleans and disinfects the canals, and seals them to prevent reinfection. Estimated chair time is about 6090 minutes. Most patients return to normal activities the same day; mild soreness can last 12 days and is manageable with overthecounter pain relievers."}, "confidence": 0.92, "recommended_treatment": "Root Canal"}, {"price": 1200, "tooth": "13", "ada_code": "D2740", "quantity": 1, "condition": "Tooth structurally weakened after Root Canal", "education": {"title": "Crown for Root CanalTreated Tooth", "definition": "After a root canal, a tooth becomes more brittle and is at higher risk of cracking or breaking, especially premolars and molars that handle chewing forces.", "status_line": "Status: 1 tooth (tooth 13) will be rootcanal treated and needs reinforcement to avoid fracture.", "risks_if_untreated": " Without a crown, the tooth is more likely to crack or fracture, which can lead to pain and may necessitate extraction. Fractures can also create sharp edges and food traps, and if the tooth breaks severely, it could affect your smile and require more extensive treatment.", "recommended_treatment": "A Crown is a custom cap that covers and protects the entire tooth. The tooth is shaped, an impression or scan is taken, and a temporary crown may be placed while the final crown is made. Seating the final crown usually occurs 12 weeks later. Each visit is typically 4575 minutes. Recovery is minimal."}, "confidence": 0.85, "recommended_treatment": "Crown"}], "stage": "Treatment Overview", "summary": "Perform Root Canal on tooth 13 to resolve the periapical infection, followed by placement of a Crown to strengthen the tooth after treatment.", "duration": "2.53.0 hours across 12 visits"}]', '2025-08-17 19:54:15.95085+00', 'https://tnkxehgocxoondivwrgs.supabase.co/storage/v1/object/public/patient-videos/patient_videos/SASAS_9ddfd64c.mp4?', 'I know dental scans can be a little overwhelming, so I''ve put this video together to guide you through the key findings from your x-ray and help you understand what we''re seeing, step by step.
INSERT INTO public.patient_diagnosis VALUES ('08bba6bb-eb07-41c4-892a-e6bfaf5d4eb1', 'c8e6cc50-576d-4d4d-bd88-18d5ebc20280', 'BVBBV', 'https://tnkxehgocxoondivwrgs.supabase.co/storage/v1/object/public/xray-images/xrays/20250818_013136_dental_xray_2.png?', 'https://tnkxehgocxoondivwrgs.supabase.co/storage/v1/object/public/xray-images/bvbbv_20250818_013136_dental_xray_2_20250818_013150.jpg?', 'Findings indicate a periapical lesion on tooth #13 requiring Root Canal treatment. Automated analysis also shows multiple existing fillings and two teeth with prior root canal therapy (tooth numbers not specified). No extractions or replacements are indicated from the provided data.', 'Manual finding confirms a periapical lesion on #13; proceed with RCT and then full-coverage crown. Obtain a periapical radiograph (and consider CBCT if lesion borders are unclear) to confirm working length and lesion extent. Perform pulp testing and percussion; manage acute symptoms with analgesics; antibiotics only if systemic signs or spreading infection. Use rubber dam isolation, working length determination (apex locator + radiograph), copious irrigation, and warm vertical or single-cone obturation per clinician preference. Place a well-sealed temporary between visits if needed. Plan definitive coronal seal promptly; a full-coverage crown on #13 is recommended to reduce fracture risk. Review existing restorations detected by AI (locations unspecified); check margins and integrity clinically and with bitewing radiographs; treat only if defective or caries present. Note: automated detections suggest two teeth with prior endodontic treatmentverify stability, absence of periapical radiolucency, and quality of obturation. Schedule follow-up radiograph at 612 months to assess periapical healing on #13.', '[{"focus": "Urgent issues affecting oral health", "items": [{"price": 400, "tooth": "13", "ada_code": "D3310", "quantity": 1, "condition": "periapical lesion", "confidence": 0.95, "patient_explanation": {"title": "Root Canal for Periapical Lesion", "definition": "A periapical lesion is an infection or inflammation at the tip of a tooths root caused by bacteria entering the nerve space.", "status_line": "1 tooth is affected (tooth #13) and needs timely care to clear the infection and save the tooth.", "risks_if_untreated": " The infection can spread, causing swelling, pain, bone loss around the root, or a dental abscess. Over time, the tooth may die and require extraction, and nearby teeth or sinuses can be affected. You might also experience bad taste/breath and possible darkening of the tooth.", "recommended_treatment": "A Root Canal removes the infected nerve tissue, disinfects the canals, and seals them to prevent reinfection. Typically completed in 12 hours (sometimes over two visits if swelling is present). Expect mild soreness for a few days; most patients return to normal activities the same day."}, "recommended_treatment": "Root Canal"}], "stage": "Stage 1", "summary": "Eliminate infection and pain at tooth #13 with Root Canal therapy.", "duration": "1.52.0 hours"}, {"focus": "Restorative care to protect and strengthen the treated tooth", "items": [{"price": 1200, "tooth": "13", "ada_code": "D2740", "quantity": 1, "condition": "postroot canal structural protection", "confidence": 0.9, "patient_explanation": {"title": "Crown for Endodontically Treated Tooth", "definition": "After a root canal, a tooth can become more brittle and prone to cracking because its inner nerve/blood supply is removed.", "status_line": "1 tooth is affected (tooth #13) and needs reinforcement to prevent fracture.", "risks_if_untreated": " The tooth is at higher risk of cracking or breaking, which can lead to pain, the need for retreatment or extraction, and additional costs. Leaks around a large filling can allow bacteria back in, risking reinfection. As a premolar, a visible chip or fracture may be noticeable when smiling.", "recommended_treatment": "A Crown is a custom cap that fully covers the tooth to restore strength and seal. Visit 1 (about 6090 minutes): shape the tooth, take a scan/impression, and place a temporary crown. Visit 2 (about 3045 minutes): cement the final crown. Normal chewing resumes quickly; mild temporary sensitivity is possible."}, "recommended_treatment": "Crown"}], "stage": "Stage 2", "summary": "Restore strength and seal on tooth #13 after Root Canal with a Crown.", "duration": "2.02.5 hours total across two short visits"}]', '2025-08-17 20:03:30.424745+00', 'https://tnkxehgocxoondivwrgs.supabase.co/storage/v1/object/public/patient-videos/patient_videos/BVBBV_48d64198.mp4?', 'I know dental scans can be a little overwhelming, so I''ve put this video together to guide you through the key findings from your x-ray and help you understand what we''re seeing, step by step.
INSERT INTO public.patient_diagnosis VALUES ('f2d78ca4-7634-4a31-85e4-5971858e26d6', 'c8e6cc50-576d-4d4d-bd88-18d5ebc20280', 'Jane Smith', 'placeholder-no-xray.jpg', 'placeholder-no-xray.jpg', 'Caries on upper right first molar (tooth 16) with reported cold sensitivity; missing lower left first molar (tooth 36). No automated detections reported.', 'Tooth 16: Clinical caries noted with patient-reported cold sensitivity. Proceed with conservative caries removal and composite restoration; assess depth intraoperatively. If dentin involvement is deep or cold sensitivity lingers post-restoration, re-evaluate pulpal status and consider possible Root Canal (D3310) and full coverage Crown (D2740) as contingency. Tooth 36: Edentulous space at mandibular left first molar. Recommend implant (D6010) with delayed restoration (crown D2740) after osseointegration. Prior to surgery, obtain CBCT to evaluate bone dimensions and proximity to the inferior alveolar canal; assess need for grafting and soft-tissue management. Review medical history, glycemic control, smoking status, and occlusal scheme. Provide informed consent covering surgical risks (paresthesia, infection, implant failure). Alternatives to implant discussed: fixed Bridge (D6240) and removable Partial Denture (D5213); document patient preference. Schedule sequence: Stage 1 filling first to remove active decay; Stage 2 implant placement with 36 months healing, then impression and delivery of implant crown. Verify occlusion and contacts at crown delivery; reinforce hygiene instructions around implant.', '[{"focus": "Urgent issues affecting oral health", "items": [{"price": 120, "tooth": "16", "ada_code": "D2330", "quantity": 1, "condition": "Caries", "confidence": 0.94, "recommended_treatment": "Filling"}], "stage": "Stage 1", "summary": "Restore decayed tooth 16 to stop progression, relieve sensitivity, and prevent deeper infection.", "duration": "0.751.0 hours"}, {"focus": "Restorative replacement of missing tooth", "items": [{"price": 2300, "tooth": "36", "ada_code": "D6010", "quantity": 1, "condition": "Missing Tooth", "confidence": 0.92, "recommended_treatment": "Implant"}, {"price": 1200, "tooth": "36", "ada_code": "D2740", "quantity": 1, "condition": "Missing Tooth", "confidence": 0.92, "recommended_treatment": "Crown"}], "stage": "Stage 2", "summary": "Replace missing tooth 36 with a dental implant and subsequent crown to restore chewing function and prevent shifting.", "duration": "2.53.0 hours total across 2 visits (surgery + crown after healing)"}]', '2025-08-18 06:07:27.050951+00', NULL, NULL, NULL);
INSERT INTO public.patient_diagnosis VALUES ('f556e897-8350-4866-a16e-87a71333fa2a', 'c8e6cc50-576d-4d4d-bd88-18d5ebc20280', 'Goman', 'placeholder-no-xray.jpg', 'placeholder-no-xray.jpg', 'Panoramic review and clinical notes indicate: (1) an impacted upper left premolar (tooth #12) recommended for removal, (2) active decay on an upper right molar with cold sensitivity consistent with a cavity, and (3) one missing lower-left molar likely #19, suitable for replacement.', 'Panoramic interpretation with clinical correlation. 1) Tooth #12: Impacted maxillary left premolar. Recommend extraction; consider CBCT or periapical imaging to confirm position, root morphology, proximity to sinus, and adjacent tooth roots. Standard surgical protocol, flap as needed; discuss risks (sinus involvement, adjacent tooth/root injury, nerve/soft tissue injury) and postoperative instructions. 2) Upper right molar caries with cold sensitivity: Perform thorough caries charting and periapical/bitewing radiographs to assess depth. Cold test and percussion to evaluate pulpal status. If sensitivity is brief and non-lingering, proceed with conservative restoration (filling). If deep caries or lingering pain, be prepared to upgrade to Root Canal (D3310, $400) and consider full-coverage Crown (D2740, $1200) depending on remaining tooth structure; inform patient of contingency prior to anesthesia. 3) Edentulous site lower-left molar (likely #19): Discuss replacement optionsImplant (D6010, $2300; preferred if adequate bone and hygiene) vs Bridge (D6240, $850; requires preparation of adjacent abutments). Evaluate with PA/CBCT as needed for implant planning, check opposing occlusion and interarch space. 4) General: Obtain current BWX/PA, update periodontal charting, caries risk assessment, and provide home-care guidance. Analgesics PRN; antibiotics only if signs of acute infection. Coordinate scheduling to complete Stage 1 (extraction + filling) in one visit if medically appropriate. Informed consent for all procedures including alternatives, risks, and benefits.', '[{"focus": "Urgent issues affecting oral health", "items": [{"price": 180, "tooth": "12", "ada_code": "D7140", "quantity": 1, "condition": "Impacted tooth", "education": {"title": "Extraction for Impacted Tooth", "definition": "An impacted tooth is one that is trapped in the gums or bone and cannot erupt normally.", "status_line": "Status: 1 tooth (tooth #12) is impacted and needs attention.", "risks_if_untreated": " If not treated, an impacted tooth can cause gum infections, damage or resorption of nearby teeth, crowding/shifting of your bite, cyst formation in the jaw, and intermittent pain.", "recommended_treatment": "We will numb the area and carefully remove the impacted tooth. The procedure typically takes about 4560 minutes. Recovery involves 37 days of gentle care with expected mild swelling and soreness, managed with pain relievers and home-care instructions."}, "confidence": 0.95, "recommended_treatment": "Extraction"}, {"price": 120, "tooth": "Upper right molar (likely #3)", "ada_code": "D2330", "quantity": 1, "condition": "Tooth decay (cavity) with cold sensitivity", "education": {"title": "Filling for Tooth Decay", "definition": "Tooth decay is the softening and breakdown of enamel and dentin caused by bacteria and acids, creating a cavity.", "status_line": "Status: 1 tooth (upper right molar) is affected and needs treatment.", "risks_if_untreated": " If not treated, the cavity can enlarge, cause persistent pain, lead to infection requiring a root canal or extraction, and weaken the tooth enough to crack. Bad breath and food trapping may also occur.", "recommended_treatment": "A filling removes the decayed portion and seals the tooth with a durable material. This protects the nerve and restores chewing. The visit usually takes 3045 minutes with numbing, and you can chew normally once numbness wears off."}, "confidence": 0.85, "recommended_treatment": "Filling"}], "stage": "Stage 1", "summary": "Address the impacted tooth and treat the symptomatic cavity to prevent pain, infection, and further structural damage.", "duration": "~1.52.0 hours (same visit if feasible)"}, {"focus": "Restorative function", "items": [{"price": 2300, "tooth": "Lower-left molar (likely #19)", "ada_code": "D6010", "quantity": 1, "condition": "Missing tooth", "education": {"title": "Implant for Missing Tooth", "definition": "A missing tooth leaves a gap that can affect chewing and allow neighboring teeth to drift.", "status_line": "Status: 1 tooth (lower-left molar) is missing and should be replaced.", "risks_if_untreated": " If not replaced, adjacent teeth can tilt into the space, the opposing tooth may over-erupt, and the jawbone in that area can shrink over time. Chewing efficiency declines, which can affect diet; appearance changes are usually minimal for a back tooth.", "recommended_treatment": "A dental implant places a small titanium post in the jaw to act as a new tooth root. Surgery typically takes 6090 minutes under local anesthesia. After a 36 month healing period, a crown is attached for full function. Most people return to normal activities within 12 days."}, "confidence": 0.8, "recommended_treatment": "Implant"}], "stage": "Stage 2", "summary": "Replace the missing lower-left molar to restore chewing efficiency and prevent tooth shifting and bone loss.", "duration": "~1.01.5 hours (surgical appointment; additional follow-ups for restoration)"}]', '2025-08-18 06:14:12.639224+00', NULL, NULL, NULL);
INSERT INTO public.patient_diagnosis VALUES ('f25e43e0-ec04-4913-9946-2f0646479c00', 'c8e6cc50-576d-4d4d-bd88-18d5ebc20280', 'Goman', 'placeholder-no-xray.jpg', 'placeholder-no-xray.jpg', 'Findings indicate: (1) active decay on an upper right molar with cold sensitivity; (2) tooth wear on tooth 47 suitable for composite build-up; and (3) a missing lower left molar that would benefit from replacement (implant preferred). No automated detections were provided.', 'Tooth numbering in source appears to use FDI. Please confirm exact teeth for the upper right molar (likely 16 or 17) and the missing lower left molar (likely 36 or 37). For the symptomatic UR molar, obtain bitewing and periapical radiographs and perform cold/endo testing to assess pulpal status; proceed with conservative composite restoration if findings are consistent with reversible pulpitis. If lingering pain or deep decay is found, discuss possible Root Canal (D3310) and subsequent Crown (D2740). Tooth 47 shows occlusal wear consistent with attrition; composite build-up planned to restore occlusal anatomyevaluate occlusion and consider a night guard if bruxism is suspected (not priced here). For the LL missing molar, recommend CBCT for implant planning, verify bone volume, and assess opposing occlusion; discuss alternative of a fixed Bridge (D6240, $850) if the patient declines implant. Note: Implant crown codes vary in practice; D2740 is used here per provided code set, but an implant-supported crown code may be more appropriate in actual billing.', '[{"focus": "Urgent issues affecting oral health", "items": [{"price": 120, "tooth": "UR molar (16/17 to confirm)", "ada_code": "D2330", "quantity": 1, "condition": "Caries (decay) with cold sensitivity", "confidence": 0.75, "patient_explanation": {"title": "Filling for Dental Decay", "status": "1 tooth affected (upper right molar). This needs attention soon to prevent deeper damage.", "definition": "Dental decay (a cavity) is the softening and breakdown of tooth structure caused by bacteria and acids.", "risks_if_untreated": " The cavity can grow, leading to significant pain, infection, and the need for a root canal or extraction. The tooth may fracture, and food trapping can cause bad breath or discoloration. If the molar shows in your smile, a dark spot may become visible over time.", "recommended_treatment": "We numb the tooth, remove the softened decay, and place a tooth-colored filling to seal and rebuild the area. Estimated chair time: 3060 minutes. Recovery is minimal; mild temperature sensitivity can occur for a few days."}, "recommended_treatment": "Filling"}], "stage": "Stage 1", "summary": "Stop active decay and address sensitivity on the upper right molar.", "duration": "~1.0 hour (single visit)"}, {"focus": "Restorative care and tooth replacement", "items": [{"price": 120, "tooth": "47", "ada_code": "D2330", "quantity": 1, "condition": "Tooth wear (occlusal)", "confidence": 0.9, "patient_explanation": {"title": "Filling for Tooth Wear", "status": "1 tooth affected (tooth 47). Addressing this now helps protect the tooth and improve function.", "definition": "Tooth wear is the gradual loss of enamel and dentin, often from grinding or clenching.", "risks_if_untreated": " Ongoing wear can expose the inner tooth, causing sensitivity and higher risk of cracks or fractures. The bite can become unbalanced, potentially accelerating wear on other teeth.", "recommended_treatment": "A composite build-up (tooth-colored filling) will rebuild the worn surface and restore biting shape. Estimated chair time: 4560 minutes. Recovery is minimal; your bite will be fine-tuned the same day."}, "recommended_treatment": "Filling"}, {"price": 2300, "tooth": "LL molar site (36/37 to confirm)", "ada_code": "D6010", "quantity": 1, "condition": "Missing molar", "confidence": 0.85, "patient_explanation": {"title": "Implant for Missing Molar", "status": "1 tooth missing (lower left molar). Replacing it will restore chewing function and prevent shifting.", "definition": "A missing tooth leaves a gap that can affect chewing and allow neighboring teeth to shift.", "risks_if_untreated": " Adjacent teeth can drift or over-erupt, bite alignment may change, and chewing efficiency decreases on that side. Bone in the area can gradually thin (resorb), making future replacement more complex. The gap may be visible when you open wide.", "recommended_treatment": "A titanium implant is placed in the bone to act as a new tooth root. Placement typically takes 6090 minutes; healing/integration takes about 34 months before the final tooth (crown) is attached. Most patients return to normal routines within 12 days after placement."}, "recommended_treatment": "Implant"}, {"price": 1200, "tooth": "LL implant site (restorative phase)", "ada_code": "D2740", "quantity": 1, "condition": "Tooth replacement completion", "confidence": 0.85, "patient_explanation": {"title": "Crown for Tooth Replacement", "status": "1 crown planned to complete the implant restoration on the lower left.", "definition": "A crown is the visible, tooth-shaped cap that restores form and function over a tooth or implant.", "risks_if_untreated": " Without the crown, the implant cannot be used for chewing. Adjacent teeth may continue to shift, and the investment in the implant will not provide functional or cosmetic benefit.", "recommended_treatment": "After the implant heals, we attach a custom abutment and place a durable, tooth-colored crown to restore chewing and appearance. Chair time: about 6090 minutes for impressions/scan and a short follow-up visit for delivery. Little to no downtime."}, "recommended_treatment": "Crown"}], "stage": "Stage 2", "summary": "Restore worn tooth 47 and replace the missing lower left molar with an implant and crown.", "duration": "~3.03.5 hours across 23 visits (implant healing 34 months between visits)"}]', '2025-08-18 06:23:43.698679+00', NULL, NULL, NULL);
